import React, { Component } from 'react';

class Membro extends Component{
   constructor(props){
    super(props);
    this.state = {
        name: props.name
    };
}
    render(){
        return(
            <div>>
                h2{this.state.name}
            </div>
        );
    }
}

export default Membro;
